package exempletext;



public class If_Else {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
// 몇 수십개의 if 문이 존재하더라도, CPU는 모든 if문을 참조합니다

		int Score = 93;
		 

		 if(Score>=90) {
			 System.out.println("합격");
			 }
		 else{
			 System.out.println("불합격");
			 }
	//else에는 ()값을 주지않음 

	}
}
